const Game = ({backHome, endScreen}) => {
  return (
    <div className='game'>
        <p className='points'>
          <span>Pontuação: 000</span>
        </p>
        <button onClick={backHome}>Início</button>
        <button onClick={endScreen}>Tela Final</button>
    </div>
    
  )
}

export default Game
